#!/bin/bash

USERNAME="XXXXXXXXXXXXXXXXXXXXXXXXXXXXX"
SECRET="XXXXXXXXXXXXXXXXXXXXXXXXXXXX"
URL="XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX"

DATE=`date -u -R`
STRING_TO_SIGN='date: '$DATE

ENCODED_SIGNATURE=$(echo -n $STRING_TO_SIGN | openssl sha1 -binary -hmac $SECRET | base64)

HMAC_AUTH='hmac username="'$USERNAME'",algorithm="hmac-sha1",headers="date",signature="'$ENCODED_SIGNATURE'"'

# GET Example 
#curl -X GET -H "date: $DATE" -H "Authorization: $HMAC_AUTH" $ENDPOINT

#POST EXAMPLE
ENDPOINT="$URL/marketplace/v1/application/submit"
curl -X POST -H "date: $DATE" -H "Authorization: $HMAC_AUTH" -H "Content-Type:application/json" --data '{
  "MPAMerchantSignaturePrincipal": "",
  "orderId": 13931,
  "PersonalGuaranteeSignaturePrincipal": "",
  "ConfirmationPageSignature": ""
}' $ENDPOINT
